export enum NoteStatus {
    Personal = 'Personal',
    Shared = 'Shared',
    Public = 'Public'
}

export interface Note {
    id: number;
    title: string;
    content: string;
    category: string;
    createdAt: Date;
    updatedAt: Date;
    userId: number;
    isPublic: boolean;
    status: NoteStatus;
    user?: User;
    collaborators?: User[];
}

export interface User {
    id: number;
    username: string;
    email: string;
    createdAt: Date;
}

export interface NoteApiResponse {
    id: number;
    title: string;
    content: string;
    category: string;
    createdAt: string;  // API returns dates as strings
    updatedAt: string;
    userId: number;
    isPublic: boolean;
    status: NoteStatus;
    user?: User;
}

// Helper function to convert API response to Note
export const convertApiResponseToNote = (apiNote: NoteApiResponse): Note => ({
    ...apiNote,
    createdAt: new Date(apiNote.createdAt),
    updatedAt: new Date(apiNote.updatedAt),
    status: apiNote.status as NoteStatus  // Ensure proper enum conversion
});
